        <div style={{display: "flexbox", flexDirection: "row"}}>
            <div className="titreSite"><a href="" className="categorie" style={{fontFamily: "system-ui", fontWeight: "bold", textDecoration: "none", color: "#f5f8b3"}}>Restaurants</a></div>
            <div>
                <input type="number" min="1" max="5" step="1" value="1"></input>
                <input type="number" min="1" max="5" step="1" value="5"></input>
            </div>
        </div>
    );
}

